import React from 'react';

class Wedding extends React.Component {
    render() {
        return (
            <div className="wedding">
                <h3>When & Where</h3>
                <div>
                    <i class="fas fa-bus fa-7x"></i>
                    <p>Shuttle Bus</p>
                </div>
                <div>
                    <i class="fas fa-bell fa-7x"></i>
                    <p>Wedding</p>
                </div>
                <div>
                    <i class="fas fa-glass-cheers fa-7x"></i>
                    <p>Party</p>
                </div>
            </div>
        )
    }
}

export default Wedding;
